export enum SpeechlyUiEvents {
  TangentRelease = 'TangentRelease',
  TangentPress = 'TangentPress',
  Notification = 'Notification',
  WarningNotification = 'WarningNotification',
  DismissNotification = 'DismissNotification',
};
